create table monsters_spawns_dungeons_groups_copy2
(
    Id              int auto_increment
        primary key,
    DungeonSpawnId  int                     null,
    MonsterGradeId  int                     null,
    MinPartyMembers int                     null,
    Informations    varchar(255) default '' null
)
    engine = MyISAM
    charset = utf8;

create index DungeonSpawnId
    on monsters_spawns_dungeons_groups_copy2 (DungeonSpawnId);

create index MonsterName
    on monsters_spawns_dungeons_groups_copy2 (Informations);

